import React from 'react';
import { Link } from 'react-router-dom';
import './styles.scss';

const ReadButton = (props) => {
  return (
    <div className='button'>
      <Link
        to={{
          pathname: `/job-guide/${props.selectedArticleId}`,
        }}
        className='apply-btn'
      >
        Read More
      </Link>

      <a href='/changelogs'>Test</a>
    </div>
  );
};

export default ReadButton;
